import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Error from "./views/Error";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="*" element={Error} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
